const mins = new Date().getMinutes();
const sec = new Date().getSeconds();







ReactDom.render(
<>
<h1>This is Ajay Karumathil</h1>
<p>Today's date is:-{date}/{mth}/{yr}</p>
<p>The time is:-{hrs}:{mins}:{sec}</p>
</>,
document.getElementById('root')
